import React from 'react';
import { useParams } from 'react-router-dom';
import {useGetRepoCollabQuery} from './api';

type Collab = {
  id: number;
  login: string;
  picture_url: string;
};

const RepoPage: React.FC = () => {
  // const owner = "facebook";
  // const repo = "react";
  const { owner, repo } = useParams<{ owner: string; repo: string }>();
  const token = "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";

  const {data: collaborators, isLoading} = useGetRepoCollabQuery({owner, repo, token});

  return (
    <div>
      <h2>Collaborators for {owner}/{repo}</h2>
      {isLoading ? (
        <p>Loading...</p>
      ) : (
        collaborators?.map((collaborator: Collab) => (
          <div key={collaborator.id}>
            console.log("OUIIIIIIIIIIIIII")
            <img
              src={collaborator.picture_url}
              alt={collaborator.login}
              width="50"
              height="50"
            />
            <p>{collaborator.login}</p>
          </div>
        ))
      )}
    </div>
  );
}

